(13, 13, 0, '<h2><img src=\\"uploaded/,%20оплатить%201_1.jpg\\" alt=\\"\\" width=\\"695\\" height=\\"318\\" /></h2>\r\n<h2><strong style=\\"font-family: arial, helvetica, sans-serif;\\"><span style=\\"color: #333333;\\">Наш интернет-магазин максимально <span style=\\"color: #ff0000;\\">автоматизирован!&nbsp;<span style=\\"color: #333333;\\">Именно поэтому Вам не придеться читать нудные инструкции о том как выбирать, оплачивать, отслеживать выбранный Вами товар. Ну разве что, только, <a href=\\"about_us\\" target=\\"_blank\\">самые основы</a>. Все интуитивно понятно. Если же, всетаки, какие то вопросы или предложения возникнут, Ваш личный консультант всегда на них ответит. </span></span></span></strong></h2>\r\n<h2><strong style=\\"font-family: arial, helvetica, sans-serif;\\"><span style=\\"color: #333333;\\"><span style=\\"color: #ff0000;\\"><span style=\\"color: #333333;\\">Итак перейдем непосредственно к тому для чего Вы здесь - к приятным покупкам.</span></span></span></strong></h2>\r\n<h2 style=\\"text-align: left;\\"><span style=\\"font-family: arial, helvetica, sans-serif;\\"><strong><span style=\\"color: #333333;\\">Для того чтобы делать покупки на Taozon.ru&nbsp;</span><span style=\\"color: #ff0000;\\"><span style=\\"color: #333333;\\">нужно </span>всего 4 шага:</span></strong></span></h2>\r\n<ol class=\\"listOL\\">\r\n<li style=\\"text-align: left;\\"><span style=\\"font-family: arial, helvetica, sans-serif; font-size: small;\\"><strong><a href=\\"allcats\\" target=\\"_blank\\">Выберите понравившиеся товары</a>&nbsp;и добавьте их в <a href=\\"basket\\" target=\\"_blank\\">корзину </a>(для этого нужно&nbsp;<a href=\\"register\\">зарегистрироваться&nbsp;на сайте</a>).&nbsp;</strong></span></li>\r\n<li style=\\"text-align: left;\\"><span style=\\"font-family: arial, helvetica, sans-serif; font-size: small;\\"><strong>Оформите заказ, следуя пошаговым подсказкам.</strong></span></li>\r\n<li style=\\"text-align: left;\\"><span style=\\"font-family: arial, helvetica, sans-serif; font-size: small;\\"><strong><a href=\\"index.php?p=privateoffice&amp;pay&amp;deposit\\" target=\\"_blank\\">Оплатите</a>&nbsp;стоимость товара и доставки. Оплата полностью автоматизирована. Сделать это вы можете множеством способов.</strong></span></li>\r\n<li style=\\"text-align: left;\\"><span style=\\"font-family: arial, helvetica, sans-serif; font-size: small;\\"><strong>Следите за перемещением товара в ваш адрес в <a href=\\"privateoffice\\" target=\\"_blank\\">\\"личном кабинете\\"</a>. Личный менеджер будет консультировать Вас по всем возникающим вопросам.</strong></span></li>\r\n</ol>\r\n<div>\r\n<h2 class=\\"editor\\" style=\\"text-align: left;\\"><span style=\\"color: #333333; font-family: arial, helvetica, sans-serif;\\">Желаем Вам, легких покупок и положительных эмоций на Taozon.ru <span style=\\"font-size: small; color: #888888;\\"><span style=\\"color: #888888;\\"><a href=\\"allcats\\">Перейти в каталог</a></span></span></span></h2>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n</div>'),
