(19, 19, 0, '<h1><span style=\\"color: #4d4d4d; font-family: Arial, Helvetica, sans-serif; font-size: 12px;\\">Понятия и определения, используемые в тексте настоящего пользовательского соглашения:</span></h1>\r\n<p><strong>Сайт</strong>&nbsp;&ndash; совокупность размещенных в сети Интернет веб-страниц, объединенных единым целевым назначением, дизайном и адресным пространством домена <a>taozon.ru</a>. Стартовая страница Сайта размещена по адресу&nbsp;<a target=\\"_blank\\">http://taozon.ru</a>.</p>\r\n<p><strong>Пользователь</strong>&nbsp;&ndash; любое лицо, принявшее условия настоящего пользовательского соглашения, зарегистрировавшееся в соответствии с требованиями указанного соглашения и начавшее использование Сайта.</p>\r\n<p><strong>Владелец Сайта</strong>&nbsp;&ndash; Буторин Денис Викторович.</p>\r\n<p><strong>Администрация Сайта</strong>&nbsp;&ndash; лица, уполномоченные Владельцем Сайта осуществлять от его имени управление и использование Сайта.</p>\r\n<p><strong>Материалы</strong>&nbsp;&ndash; текст и/или изображение.</p>\r\n<p><strong>Товар</strong>&nbsp;&ndash; имущество, не изъятое из оборота или не ограниченное в обороте, информация о котором размещена Пользователями на Сайте.</p>\r\n<p><strong>Целевое назначение Сайта</strong>&nbsp;&ndash; предоставление Пользователям технической возможности размещения на страницах Сайта Материалов, содержащих всю необходимую для совершения Пользователями в отношении Товара сделок купли-продажи, мены или дарения информацию, и доступа к указанной информации.</p>\r\n<p>&nbsp;</p>\r\n<p><strong><em>1. Общие положения</em></strong></p>\r\n<p>1.1. Настоящее пользовательское соглашение регулирует отношения между Владельцем Сайта в лице Администрации Сайта и Пользователями Сайта, возникающие в связи с использованием Сайта.</p>\r\n<p>1.2. Настоящее пользовательское соглашение вступает в силу непосредственно после выражения Пользователем согласия с условиями данного Соглашения путем нажатия Пользователем кнопки &laquo;<strong>Я согласен(на) с</strong>&raquo; во время регистрации на сайте.</p>\r\n<p>1.3. Вопросы, не урегулированные настоящим пользовательским соглашением, регламентируются законодательством РФ.</p>\r\n<p>1.4. Положения настоящего пользовательского соглашения устанавливаются, изменяются и отменяются Администрацией Сайта в одностороннем порядке без согласия Пользователей Сайта. С момента размещения на Сайте новой редакции пользовательского соглашения предыдущая редакция считается утратившей свою силу.</p>\r\n<p>1.5. Действующая редакция настоящего пользовательского соглашения размещена в сети Интернет по адресу<a href=\\"?p=main_user_agreement&amp;edit&amp;pid=19\\">http://taozon.ru/?p=main_user_agreement&amp;edit&amp;pid=19</a>.</p>\r\n<p>&nbsp;</p>\r\n<p><strong><em>2. Порядок регистрации</em></strong></p>\r\n<p>2.1. Для получения возможности размещения на Сайте своих Материалов и доступа к Материалам других Пользователей Пользователю необходимо осуществить процедуру регистрации, заключающуюся в выполнении следующих действий: - заполнить форму регистрации; - подтвердить введенные данные.</p>\r\n<p>2.2. По завершении процесса регистрации Пользователь получает логин и пароль для получения возможности размещения на Сайте своих Материалов и доступа к Материалам других Пользователей. Пользователь несет ответственность за безопасность своего логина и пароля, а также за все, что будет сделано на Сайте под логином и паролем Пользователя. Администрация Сайта имеет право запретить использование определенных логинов и/или изъять их из обращения. Пользователь соглашается с тем, что он обязан немедленно уведомить Администрацию Сайта о любом случае не разрешенного Пользователем доступа с логином и паролем Пользователя и/или о любом нарушении безопасности, а также с тем, что Пользователь самостоятельно осуществляет завершение работы под своим паролем по окончании каждой сессии работы с ресурсами Сайта.</p>\r\n<p>&nbsp;</p>\r\n<p><strong><em>3. Права и обязанности Пользователя</em></strong></p>\r\n<p>3.1. Пользователь вправе использовать Сайт по его Целевому назначению.</p>\r\n<p>3.2. Пользователь обязан соблюдать условия, предусмотренные настоящим пользовательским соглашением.</p>\r\n<p>3.3.&nbsp;Зарегистрировавшись на сайте и/или отметив пункт \\"Я даю согласие на использование моих персональных данных\\" при формировании заказа,&nbsp;Пользователь разрешает использование своих персональных данных Администрации Сайта Taozon c целью улучшения качества услуг, информирования Пользователя о покупках, для извещения Пользователя о новостях, для возможности участия в конкурсных программах и иных сервисах, предусмотренных для посетителей Сайта, о мероприятиях, проводимых компанией и партнерами, а также для достижения целей, предусмотренных другими пунктами пользовательского соглашения.</p>\r\n<p>3.4. Пользователь дает свое согласие на то, что в случае смены каких-либо персональных данных, относящихся к пользователю, условия данного соглашения и ранее предоставленные данные, а так же все устаревшие персональные данные пользователя теряют силу с момента получения владельцем сайта новых персональных данных пользователя. С указанного момента действуют условия, содержащие новые персональные данные пользователя.</p>\r\n<p>3.5. Пользователь имеет право отозвать данное ранее согласие на использование перснальных данных, обратившись письменно к Администрации Сайта.</p>\r\n<p>&nbsp;</p>\r\n<p><strong><em>4. Права и обязанности Администрации Сайта</em></strong></p>\r\n<p>4.1. Администрация Сайта осуществляет текущее управление Сайтом и определяет порядок его использования, определяет состав сервисов Сайта, его структуру и внешний вид, разрешает и ограничивает доступ к ресурсам Сайта, осуществляет иные принадлежащие ей права.</p>\r\n<p>4.2. Администрация Сайта вправе в одностороннем порядке без согласия Пользователя по любым причинам, в том числе, но не ограничиваясь, в случае нарушения Пользователем условий, установленных настоящим пользовательским соглашением, удалить учетную запись и Материалы, размещенные Пользователем на Сайте.</p>\r\n<p>4.3. Администрация Сайта вправе в одностороннем порядке без согласия Пользователя вносить в Материалы, размещенные последним на Сайте, изменения, сокращения и дополнения, снабжать указанные Материалы иллюстрациями, предисловием, послесловием, комментариями или какими бы то ни было пояснениями.</p>\r\n<p>4.4. Администрация Сайта вправе в одностороннем порядке без согласия Пользователя удалять Материалы, нарушающие закон или создающие угрозу такого нарушения.</p>\r\n<p>4.5. Администрация Сайта не занимается рассмотрением и разрешением споров и конфликтных ситуаций, возникающих между Пользователями, однако оставляет за собой право заблокировать доступ Пользователя к Сайту в случае получения от других Пользователей мотивированных жалоб на некорректное поведение данного Пользователя на Сайте.</p>\r\n<p>4.6. Администрация сайта, получив согласие Пользователя на использование его личных данных, вправе собирать, хранить, передавать и обрабатывать персональные данные Пользователя для его информирования по указанным адресам почты и электронной почты о проводимых акциях, конкурсах и других мероприятиях компании и ее партнеров.</p>\r\n<p>&nbsp;</p>\r\n<p><strong><em>5. Условия использования ресурсов Сайта</em></strong></p>\r\n<p>5.1. Пользователь вправе использовать ресурсы Сайта исключительно в соответствии с требованиями, установленными настоящим пользовательским соглашением и законодательством РФ.</p>\r\n<p>5.2. Пользователь <strong>не вправе</strong>: - использовать Сайт с целью совершения уголовно наказуемых деяний; - размещать на Сайте Материалы, содержащие сведения, составляющие государственную или иную специально охраняемую законом тайну, призывы к осуществлению террористической деятельности или публично оправдывающие терроризм, другие экстремистские Материалы, Материалы, пропагандирующие порнографию, культ насилия и жестокости, а также Материалы, содержащие порнографические изображения и тексты, оскорбительные, непристойные и нецензурные слова и выражения; - размещать на Сайте Материалы, содержащие пропаганду или агитацию социальной, расовой, национальной или религиозной ненависти и вражды, пропаганду войны, социального, расового, национального, религиозного или языкового превосходства; - использовать в размещаемых на Сайте Материалах скрытых вставок и иных технических приемов и способов распространения информации, воздействующих на подсознание людей и (или) оказывающих вредное влияние на их здоровье, а равно распространение информации об организациях, в отношении которых судом принято вступившее в законную силу решение о ликвидации или запрете деятельности по основаниям, предусмотренным законом без указания на то, что соответствующее общественное объединение или иная организация ликвидированы или их деятельность запрещена; - распространять в размещаемых на Сайте Материалах сведения о способах, методах разработки, изготовления и использования, местах приобретения наркотических средств, психотропных веществ и их прекурсоров, пропагандировать какие-либо преимущества использования отдельных наркотических средств, психотропных веществ, их аналогов и прекурсоров, а также распространять иную информацию, распространение которой запрещено федеральными законами; - размещать Материалы, нарушающие права третьих лиц на неприкосновенность их частной жизни, личной и семейной тайны; - размещать Материалы, содержащие сведения, порочащие честь, достоинство или деловую репутацию третьих лиц; - размещать Материалы, нарушающие вещные, неимущественные и иные права третьих лиц; - осуществлять сбор персональных данных других Пользователей с целью их последующей обработки, т.е. совершения действий (операций) с персональными данными, включая их сбор, систематизацию, накопление, хранение, уточнение (обновление, изменение), использование, распространение (в том числе передачу), обезличивание, блокирование и уничтожение; - размещать на Сайте персональные данные, в том числе контактные данные других Пользователей или иных лиц без их предварительного согласия; - размещать на Сайте изображения третьих лиц без их предварительного согласия, за исключением случаев, предусмотренных законом; - указывать при регистрации или вводить впоследствии заведомо ложную или вымышленную информацию о себе, в частности чужие или вымышленные имя и фамилию; - размещать на Сайте Материалы, содержащие недостоверные сведения о товаре; - размещать на Сайте Материалы, содержащие сведения о товаре, изъятом из оборота или ограниченном в обороте; - использовать Сайт не по Целевому назначению; - совершать иные действия (бездействие), прямо или косвенно связанные с использованием им Сайта, за которые законодательством РФ предусмотрена гражданская, административная, уголовная или иные виды ответственности.</p>\r\n<p>5.3. Пользователь несет полную ответственность за последствия, наступившие в результате нарушения им любого из условий, предусмотренных настоящим пользовательским соглашением, и обязуется своими силами и за свой счет удовлетворить все связанные с этим обоснованные требования третьих лиц. Также Пользователь обязан своими силами и за свой счет урегулировать споры и удовлетворить все обоснованные требования третьих лиц, прямо или косвенно связанные с использованием Сайта Пользователем.</p>\r\n<p>5.4. Ни Владелец Сайта, ни Администрация Сайта не несут ответственности: - за несоответствие требованиям законодательства РФ Материалов, размещенных на Сайте; - за причинение вреда жизни и здоровью третьих лиц вследствие качественных, конструктивных, рецептурных или иных недостатков Товара, информация о которых размещена на Сайте; - за размещение на Сайте неполной и/или недостоверной информации о Товарах; - за нарушение вещных, неимущественных и иных прав третьих лиц, связанных с использованием Сайта Пользователем; - за полную или частичную утрату Материалов, размещаемых Пользователем на Сайте, а также за недостаточное качество или скорость работы сервисов Сайта; - за последствия, наступившие в результате нарушения Пользователями условий настоящего пользовательского соглашения; - за иные действия (бездействие) Пользователей, прямо или косвенно связанные с использованием ими Сайта, за которые законодательством РФ предусмотрена гражданская, административная, уголовная или иные виды ответственности, и/или повлекших за собой причинение вреда и/или убытков третьим лицам.</p>\r\n<p>5.5. Ни Администрация Сайта, ни Владелец Сайта не возмещают ущерб, прямой или косвенный, причиненный Пользователю или третьим лицам в результате использования или невозможности использования Сайта.</p>\r\n<p>5.6. В случае наступления обстоятельств не по вине Владельца Сайта или Администрации Сайта, связанных с использованием Сайта Пользователем и повлекших причинение убытков Владельцу Сайта или Администрации Сайта в том числе, но не ограничиваясь, наложение штрафов государственными контролирующими органами, предъявление третьими лицами требований, исков и претензий, досудебное и судебное урегулирование споров с третьими лицами, Пользователь обязан возместить Владельцу Сайта или Администрации Сайта все понесенные им в связи с этим убытки в течение 3 (трех) банковских дней с момента предъявления Владельцем Сайта или Администрацией Сайта требования об этом на основании выставленного им счета.</p>'),
