(23, 23, 0, '<p><span style=\\"font-family: Arial; font-size: 21px; font-weight: bold; line-height: 23px;\\"><img style=\\"font-family: Arial, Helvetica, sans-serif; font-size: 12px;\\" src=\\"uploaded/support%201.jpg\\" alt=\\"\\" width=\\"695\\" height=\\"249\\" /></span></p>\r\n<p><span style=\\"font-family: Arial; font-size: 21px; font-weight: bold; line-height: 23px;\\">Наш ресурс максимально автоматизирован и интуитивно понятен, однако, если у вас возникли вопросы при работе с сервисом, Вы можете задать их следующими способами:</span></p>\r\n<p><span>1.&nbsp;</span><strong>Обратиться к \\"ОНЛАЙН КОНСУЛЬТАНТУ\\" (<span style=\\"color: #ff0000;\\">красный&nbsp;</span>ярлычек справа на сайте)</strong></p>\r\n<p class=\\"textContent\\"><span><strong>2.&nbsp;</strong></span><span><strong>Отправив электронное письмо на&nbsp;</strong></span><span style=\\"color: #3366ff;\\"><strong><a href=\\"mailto:info@taozon.ru\\"><span style=\\"color: #3366ff;\\">info@taozon.ru</span></a></strong></span></p>\r\n<p><span><strong>3.&nbsp;</strong></span><strong>Обратившись в&nbsp;<span style=\\"color: #888888;\\"><a href=\\"index.php?p=support&amp;mode=new\\" target=\\"_blank\\"><span style=\\"color: #888888;\\">службу поддержки</span></a>. (<span style=\\"color: #ff0000;\\">только зарегистрированным пользователям!</span>)</span></strong></p>\r\n<p><span><strong>4.&nbsp;</strong></span><strong>По телефону:</strong></p>\r\n<div class=\\"textContent\\">\r\n<p><span><strong><span>Тел оф.: +7 (4162) 53-65-10 (пн-пт, с 03.00 до 15.00 МСК)</span></strong></span></p>\r\n<p><strong><span>Тел сот.: +7 (9638) 14-37-88&nbsp;<strong>(пн-вс, с 03.00 до 16.00 МСК)</strong></span></strong></p>\r\n<h4 class=\\"editor\\">Будем рады Вам помочь !</h4>\r\n</div>'),
(24, 24, 0, '<h1><span style=\\"font-size: 1em; color: #4d4d4d; font-family: Arial, Helvetica, sans-serif;\\">Политика безопасности и сохранности данных пользователей интернет-магазина Taozon.ru</span></h1>\r\n<h4><span style=\\"line-height: 16px;\\">Общие положения</span></h4>\r\n<p>Сохранность и защита сведений о пользователях нашего сервиса очень важны для нас. При обработке сведений о пользователях сервиса мы принимаем все необходимые технические и организационные меры для защиты данных от неправомерного или случайного доступа к ним, распространения информации о пользователях, а также от иных неправомерных действий, что указано в этом документе. В своей работе мы руководствуемся правилами Конвенции о защите физических лиц при автоматизированной обработке персональных данных (Страсбург, 28 января1981 г.).</p>\r\n<h5>Безопасность покупок на Taozon.ru</h5>\r\n<p>Совершая заказы на Taozon.ru, пользователи должны быть&nbsp;<strong>уверены в безопасности транзакций и операций</strong>. В своей работе мы используем&nbsp;<strong>криптографический протокол SSL</strong>, который обеспечивает установление безопасного соединения и передает конфиденциальные данные только в&nbsp;<strong>зашифрованном виде</strong>. Мы предпринимаем другие необходимые технические и организационные меры в целях сохранения конфиденциальности любой информации о пользователях и любых коммуникаций.</p>\r\n<p>При этом пользователи понимают и соглашаются, что Taozon.ru как Интернет-сервис не может предоставить гарантии абсолютной безопасности коммуникаций между пользователями и сервисом и гарантии абсолютной защиты информации о пользователях, сообщенной сервису.</p>\r\n<h5>Сведения о пользователе и авторизация</h5>\r\n<p>Работа с сервисом Taozon.ru включает в себя две категории операций:</p>\r\n<p>&mdash; выбор, поиск товаров, добавление их в корзину (возможен анонимный доступ);<br /> &mdash; оформление заказа и оплату (требуется авторизация).</p>\r\n<p>Просмотр, чтение, поиск и выбор товаров может осуществляться&nbsp;<strong>анонимно</strong>, процедура оформления и оплаты заказа требует авторизации на сайте. При первичной регистрации на сайте мы производим сбор информации о пользователе в объеме, необходимом для совершения покупок, включая (но не ограничивая): фамилию, имя, отчество, адрес электронной почты, фактический адрес доставки посылок, пароль, дату рождения, пол. Пользователь несет полную личную ответственность за корректность предоставленной информации. В отдельных случаях мы оставляем за собой право запроса подтверждения полученной информации.</p>\r\n<p>Пользователю может быть отказано в регистрации под логином, который может вводить в заблуждение относительно личности его владельца, содержать грубое или оскорбительное слово, обозначать товарный знак или иным образом нарушать право на интеллектуальную собственность, иные права третьих лиц, а также в иных случаях по усмотрению администрации сервиса.</p>\r\n<h5>Информация о платежах</h5>\r\n<p>Вся информация о платежах, проведенных пользователем в счет уплаты товара, заказанного на Taozon.ru, передается в службу контроля платежей и расчетов. Мы&nbsp;<strong>проверяем полученные данные </strong>(фамилию, имя, отчество плательщика, дату совершения платежа, сумму платежа, номер заказа в нашей системе), и зачисляем полученные средства на счет пользователя. Мы также&nbsp;<strong>гарантируем сохранность данных</strong>, полученных о платежах клиентов.</p>\r\n<p>Объем информации, необходимой для корректной идентификации платежа, зависит от метода платежа и может изменяться. Мы поддерживаем несколько вариантов оплаты заказанных товаров, включая оплату с помощью&nbsp;<em>электронных платежных систем, платежных терминалов Qiwi и др., онлайн-платежи с помощью банковских карт</em>.</p>\r\n<h5>Безопасность онлайн-платежей</h5>\r\n<p>Все операции с платежными картами происходят в соответствии с требованиями VISA International, MasterCard и других платежных систем. При передаче информации используется специальные технологии безопасности карточных онлайн-платежей, обработка данных ведется на безопасном высокотехнологичном сервере процессинговой компании, которая прошла международную сертификацию безопасности PCI DSS и SA HackerSafe.</p>\r\n<p>Это значит, что все указываемые вами при расчетах банковской картой данные (имя, адрес, телефон, e-mail, номер кредитной карты) в соответствии с требованиями международных платежных систем после проведения оплаты не сохраняются ни на сервере Taozon, ни на авторизационном сервере процессинговой компании. Обработка данных полностью защищена и никто, в том числе Taozon, не может получить ваши персональные и банковские данные, включая информацию о ваших покупках, сделанных в других магазинах.</p>\r\n<h5>Информация о заказах</h5>\r\n<p>Сервис Taozon.ru хранит всю историю заказов пользователя, а также историю общения и взаимодействия с сервисом, не изменяет и не удаляет эту информацию по запросам пользователей или третьих лиц, информация может быть удалена только по письменному запросу самого пользователя. Срок хранения информации о заказах определяется по усмотрению сервиса. Эта информация&nbsp;<strong>не доступна публично</strong>, с ней может ознакомиться только авторизованный пользователь, к которому относится данная информация. Для этого необходимо пройти&nbsp;<strong>процедуру авторизации</strong>&nbsp;на сайте с указанием логина и пароля. Сервис Taozon.ru&nbsp;<strong>несет полную ответственность за сохранность данных, относящихся к пользователю, и их защиту от неправомерного или случайного доступа к ним</strong>, распространения данных, а также от иных неправомерных действий.</p>\r\n<h5>Другая информация о пользователях</h5>\r\n<p>Сервис Taozon.ru оставляет за собой право проведения опросов, викторин и специальных акций. В некоторых случаях нам потребуется дополнительные сведения о пользователе, добровольно решившим принять участие в мероприятиях Taozon.ru (только при получении подтверждения пользователя). Мы также несем полную ответственность за сохранность, защиту и нераспространение полученных сведений.</p>\r\n<p>Мы также можем запросить:</p>\r\n<p>&mdash; информацию, которую вы нам предоставляете с целью получения электронных уведомлений, подписки на наши рассылки и иных сообщений;<br /> &mdash; демографическую (статистическую) информацию, такую как вид деятельности вашей компании, возраст, пол, страна проживания и др.;<br /> &mdash; другую интересующую нас информацию, которую вы согласитесь предоставить.</p>\r\n<h5>Иные сведения</h5>\r\n<p>Мы можем в автоматизированном режиме получать информацию от браузера, который вы используете для доступа к нашему сервису, такую как ваш IP-адрес, тип браузера, его версию и язык, время и продолжительность посещения сайта, Uniform Resource Locator (URL) Интернет-сайта, с которого вы перешли на наш сайт или на который вы перешли с нашего сайта, если вы прошли по гиперссылке, размещенной на нашем сайте.</p>\r\n<p>Программно-аппаратный комплекс сайта автоматически фиксирует и сохраняет протоколы, в которых отражено использование сайта, просмотренные Пользователем страницы сайта, гиперссылки и рекламные объявления, на которые вы кликаете, ваши поисковые запросы. Мы используем эти данные для получения статистической информации о своих пользователях и для предупреждения/пресечения нарушений Соглашения.</p>\r\n<p>Наш сайт, интерактивные приложения, онлайн сервисы, сообщения электронной почты и рекламные объявления могут использовать &laquo;куки&raquo; (cookies) и другие подобные технологии (pixel tags, web beacons). Куки содержат информацию, которая записывается на жесткий диск вашего компьютера. Вы можете отказаться от использования куки, применяя соответствующие настройки вашего браузера, который позволяет вам отказаться от установки куки (возможно, в результате вы не сможете использовать в полном объеме все возможности нашего сайта). Если вы не откажетесь от использования куки, наш сервис будет отправлять куки, когда вы получаете доступ к нашему сайту.</p>\r\n<h5>Контроль использования пользователем сведений о себе</h5>\r\n<p>Вы можете в любое время&nbsp;<strong>изменить информацию о пользователе</strong>, предоставленную Taozon.ru. Для этого необходимо авторизоваться на сайте и произвести необходимые изменения в личном кабинете. Пожалуйста, ознакомьтесь с процедурой изменения личных данных.</p>\r\n<h5>Обязанности пользователя</h5>\r\n<p>Пользователь несет ответственность за сохранение конфиденциальности своего логина и пароля на Taozon.ru. Помните, что сервис Taozon.ru никогда не будет запрашивать ваш пароль.</p>\r\n<p>Пользователь несет ответственность за достоверность предоставленных сервису сведений и обновление информации, которая требуется для исполнения заключенных с сервисом Taozon.ru договоров. В случае невозможности исполнения заказа из-за предоставления некорректной информации вы будете обязаны компенсировать сервису причиненные убытки.</p>\r\n<p>В случае получения сомнительных сообщений или запросов от имени сервиса, пожалуйста, информируйте нас.</p>\r\n<h5>Предоставление информации третьим лицам</h5>\r\n<p>Мы можем раскрыть информацию, связанную с пользователем, в случаях и в порядке, предусмотренных законодательством Шотландии, Европейского Союза и положений Конвенции о защите физических лиц при автоматизированной обработке персональных данных (Страсбург, 28 января1981 г.). Мы также обмениваемся информацией о заказах (и/или платежах соответственно) поставщикам заказанных вами товаров, почтовым службам, страховым компаниям, банкам и другим лицам, участвующим в процессе исполнения вашего заказа.</p>\r\n<p>Мы можем раскрыть сведения о пользователе государственным правоохранительным или судебным органам, если мы обоснованно полагаем, что раскрытие информации необходимо в целях защиты нашей деятельности или пользователей или раскрытия преступления.</p>\r\n<p>Информация о пользователе может быть предоставлена на условиях конфиденциальности любому сотруднику (работнику) нашей компании, аудиторам, юристам и иным консультантам. В дополнение в случае реорганизации мы можем предоставить информацию о пользователях компании-правопреемнику.</p>\r\n<p>За исключением вышеперечисленного информация о заказах и пользователях не предоставляется третьим лицам.</p>'),
(25, 25, 0, '<h4><strong><img src=\\"uploaded/%20нас%20Taozon%201.jpg\\" alt=\\"\\" width=\\"693\\" height=\\"330\\" /></strong></h4>\r\n<p><strong><span style=\\"font-size: medium;\\">Как сказала Голда Меир&nbsp;</span><span style=\\"font-size: small;\\">(5-й премьер-министр Израиля):</span><span style=\\"font-size: medium;\\">&nbsp;\\"Не будь так скромен &mdash; ты еще не настолько велик\\"</span></strong></p>\r\n<p>Мы, пожалуй, последуем ее совету и нескромно расскажем Вам о наших преимуществах, в противном случае, это так и может остаться тайной для Вас. Но сначала, буквально два слова&nbsp;не о нас.</p>\r\n<p><span style=\\"font-size: 1em; font-family: Arial, Helvetica, sans-serif;\\">Большинство ресурсов предлагающих доставку из Китая, ФИЗИЧЕСКИ находятся в разных городах РФ, никак не граничащих с Китаем и именно по этой причине пользуются только 2 способами доставки товаров:&nbsp;<span style=\\"color: #ff6600;\\"><a href=\\"http://english.chinapost.com.cn/\\" target=\\"_blank\\">China Post</a>&nbsp;</span>и&nbsp;<span style=\\"color: #ff6600;\\"><a href=\\"http://www.emspost.ru/ru\\" target=\\"_blank\\">EMS</a></span>. Неплохие варианты. Они тоже есть в нашей коллекции видов доставки. (Ограничения по весу, сроки доставки и цены <span><a href=\\"http://english.chinapost.com.cn/\\" target=\\"_blank\\">China Post</a>&nbsp;</span>и&nbsp;<span><a href=\\"http://www.emspost.ru/ru\\" target=\\"_blank\\">EMS</a></span>&nbsp;найдете <a href=\\"http://www.emspost.ru/ru/tarifi_sroki/\\" target=\\"_blank\\">здесь</a>). </span></p>\r\n<p><span style=\\"font-size: 1em; font-family: Arial, Helvetica, sans-serif;\\">Офисы компании Taozon расположены в Благовещенске - в пятистах метрах от Китая (<a href=\\"http://saveimg.ru/show-image.php?id=a811aecf57902a80f5bca81f4e6b5c95\\" target=\\"_blank\\">смотреть на карте</a>), а так же в Пекине и Хэйхэ. Что позволяет снизить стоимость доставки, уменьшить сроки и расширить ассортимент видов доставки.</span></p>\r\n<h4 class=\\"editor\\">А, согласитесь, самый нелегкий выбор &ndash; между хорошим и лучшим !</h4>\r\n<h4>Поэтому, мы предложим Вам вырианты, а Вы сами выбирайте подходящий.</h4>\r\n<table border=\\"1\\" cellspacing=\\"0\\" cellpadding=\\"0\\">\r\n<tbody>\r\n<tr>\r\n<td class=\\"editor\\" style=\\"text-align: center;\\" valign=\\"top\\" width=\\"319\\">\r\n<h1 align=\\"center\\"><span style=\\"color: #003300; font-family: tahoma, arial, helvetica, sans-serif; font-size: large; line-height: 23px;\\">Авиа - Экспресс доставка</span></h1>\r\n</td>\r\n<td style=\\"text-align: center;\\" valign=\\"top\\" width=\\"319\\">\r\n<h1 class=\\"editor\\"><span style=\\"color: #003300; font-family: tahoma, arial, helvetica, sans-serif; font-size: large;\\">Авто и Ж/Д доставка</span></h1>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td valign=\\"top\\" width=\\"319\\">\r\n<h3 class=\\"editor\\"><span style=\\"font-family: tahoma, arial, helvetica, sans-serif; font-size: small; color: #003300;\\">Международная служба доставки EMS&nbsp;</span><span style=\\"color: #888888; font-size: x-small;\\">Cрок доставки 14-21 день. Доставка курьером по указанному адресу.</span></h3>\r\n</td>\r\n<td class=\\"editor\\" valign=\\"top\\" width=\\"319\\">\r\n<h3><span style=\\"font-family: tahoma, arial, helvetica, sans-serif;\\"><span style=\\"color: #003300; font-size: small; line-height: 16px;\\">&laquo;ЖелДорЭкспедиция&raquo;&nbsp;</span><span style=\\"color: #888888; font-size: x-small;\\">Любой город РФ. Срок доставки 10-21 день. НЕТ ограничений по весу. (стоимость включает КАРГО через границу) Самостоятельное получение на складе.</span></span></h3>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td valign=\\"top\\" width=\\"319\\">\r\n<h3 class=\\"editor\\"><span style=\\"font-family: tahoma, arial, helvetica, sans-serif;\\"><span style=\\"font-size: small; color: #003300;\\"><strong>China Post.&nbsp;</strong></span><span style=\\"font-size: x-small;\\"><span style=\\"color: #888888;\\">Сервис доставки посылок весом до 20 кг.</span><span style=\\"color: #888888;\\">Срок доставки 20-45 дней. Самостоятельное получение в почтовом отделении.</span></span></span></h3>\r\n</td>\r\n<td class=\\"editor\\" valign=\\"top\\" width=\\"319\\">\r\n<h3><span style=\\"font-family: tahoma, arial, helvetica, sans-serif;\\"><span style=\\"color: #003300; line-height: 16px; font-size: small;\\">Доставка &laquo;ЭНЕРГИЯ&raquo;&nbsp;</span><span style=\\"color: #888888; font-size: x-small;\\">Любой город РФ. Срок доставки &mdash; 8-18 дней. НЕТ ограничений по весу. (стоимость включает КАРГО через границу) Самостоятельное получение на складе.</span></span></h3>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td class=\\"editor\\" valign=\\"top\\" width=\\"319\\">\r\n<h3><span style=\\"font-family: tahoma, arial, helvetica, sans-serif;\\"><span style=\\"color: #003300; line-height: 16px; font-size: small;\\">China Post Airmail.&nbsp;</span><span style=\\"font-size: x-small;\\"><span style=\\"color: #888888;\\">Сервис доставки посылок весом до 2 кг.&nbsp;</span><span style=\\"color: #888888;\\">Срок доставки 20-45 дней. Самостоятельное получение в почтовом отделении.</span></span></span></h3>\r\n</td>\r\n<td valign=\\"top\\" width=\\"319\\">\r\n<h4>&nbsp;</h4>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td valign=\\"top\\" width=\\"319\\">\r\n<h4><span style=\\"font-family: tahoma, arial, helvetica, sans-serif; font-size: small; color: #003300;\\">ЭКСПРЕСС доставка &laquo;СДЭК&raquo;</span><span style=\\"font-size: x-small; font-family: tahoma, arial, helvetica, sans-serif;\\">&nbsp;<span style=\\"color: #888888;\\">Любой город РФ. Доставка до двери. Срок доставки &nbsp;3-10 дней. (в стоимость входит КАРГО через границу)</span></span></h4>\r\n</td>\r\n<td valign=\\"top\\" width=\\"319\\">\r\n<h4>&nbsp;</h4>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td valign=\\"top\\" width=\\"319\\">\r\n<h4><span style=\\"font-family: tahoma, arial, helvetica, sans-serif; font-size: small; color: #003300;\\"><span style=\\"line-height: 16px;\\">ЭКСПРЕСС доставка &laquo;ЭНЕРГИЯ&raquo;&nbsp;</span></span><span style=\\"font-size: x-small; font-family: tahoma, arial, helvetica, sans-serif;\\"><span style=\\"color: #888888;\\">Любой город РФ. Срок доставки &mdash; 3-8 дней. Самостоятельное получение на складе. (стоимость включает КАРГО через границу)</span></span></h4>\r\n</td>\r\n<td valign=\\"top\\" width=\\"319\\">\r\n<h4>&nbsp;</h4>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td valign=\\"top\\" width=\\"319\\">\r\n<h4><span style=\\"font-size: x-small; font-family: tahoma, arial, helvetica, sans-serif;\\"><span style=\\"color: #003300; line-height: 16px; font-size: small;\\">Благовещенск. Карго доставка.&nbsp;</span><span style=\\"color: #888888;\\">Карго доставка. Срок доставки до 7 дней. Самостоятельное получение на складе в Благовещенске.</span></span></h4>\r\n</td>\r\n<td valign=\\"top\\" width=\\"319\\">\r\n<h4>&nbsp;</h4>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td valign=\\"top\\" width=\\"319\\">\r\n<h4><span style=\\"font-size: x-small; font-family: tahoma, arial, helvetica, sans-serif;\\"><span style=\\"color: #003300; line-height: 16px; font-size: small;\\">Taozon. ЭКСПРЕСС доставка до Москвы.&nbsp;</span><span style=\\"color: #888888;\\">Доставка до Москвы. Срок 3-6 дней. Получение груза в аэропортах Домодедово и Внуково самостоятельное.</span></span></h4>\r\n</td>\r\n<td valign=\\"top\\" width=\\"319\\">\r\n<h4>&nbsp;</h4>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\\"2\\" valign=\\"top\\" width=\\"638\\">\r\n<h4><span style=\\"color: #003300; font-family: tahoma, arial, helvetica, sans-serif; font-size: small; line-height: 16px;\\">Для Вашего удобства, сравнить цены того или иного вида доставки можно в </span><span style=\\"color: #888888;\\"><span style=\\"font-family: tahoma, arial, helvetica, sans-serif; font-size: small; line-height: 16px; color: #888888;\\"><a href=\\"calculator\\" target=\\"_blank\\">КАЛЬКУЛЯТОРЕ</a>&nbsp;</span></span><span style=\\"color: #003300; font-family: tahoma, arial, helvetica, sans-serif; font-size: small; line-height: 16px;\\">нашего сайта.</span></h4>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\\"2\\" valign=\\"top\\" width=\\"638\\">\r\n<h4><span style=\\"color: #888888; font-family: verdana, geneva; font-size: small;\\">*Виды доставки с расчетом стоимости появятся автоматически при оформлении заказа.</span></h4>\r\n<h4><span style=\\"color: #888888; font-family: verdana, geneva; font-size: small;\\">**Список компаний постоянно пополняется.</span></h4>\r\n<h4>&nbsp;</h4>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h4><strong style=\\"font-size: 1em;\\">Taozon</strong><span style=\\"font-size: 1em;\\">&nbsp;&ndash; молодая, но быстро развивающаяся компания, ориентированная на качественное и своевременное обслуживание Вас - наших Клиентов.</span></h4>\r\n<h4><strong>Taozon.ru</strong>&nbsp;&mdash; интернет-магазин, ориентированный на Россию и СНГ в области электронной торговли, включающий в себя в себя полный цикл услуг по работе c крупнейшей торговой площадкой Китая Таобао. Taozon располагается на платформе Powered by &copy; Opentao platform являющейся одобренным партнером Taobao Open Platform с 2011 года. Компания имеет службу поддержки клиентов в России и собственный склад по обработке заказов в Пекине.</h4>\r\n<p>Taozon.ru не имеет никаких дочерних компаний, работает только под своим именем. Любые заявления о том, что проект поменял владельцев или был переименован, не соответствуют действительности.</p>\r\n<p>Сайт Taozon.ru размещен только на домене <strong>Hetzner, </strong><strong>Germany.&nbsp;</strong></p>\r\n<p>Проект реализован на специализированной мощной платформе и обладает распределенной IT-инфраструктурой с зарубежными дата-центрами, что обеспечивает его стабильную и непрерывную работу.</p>\r\n<h4><span style=\\"font-size: 1em;\\">Преимущества сервиса Taozon.ru:</span></h4>\r\n<p><strong>Честность сделок:</strong></p>\r\n<ul class=\\"listUL\\">\r\n<li>Taozon располагается на платформе Powered by &copy; Opentao platform являющейся одобренным партнером Taobao Open Platform с 2011 года.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>С </strong><strong>Taozon </strong><strong>удобно:</strong></p>\r\n<ul class=\\"listUL\\">\r\n<li>каталог описание и отзывы о товарах на русском языке;</li>\r\n<li>полностью автоматизированная оплата, расчеты в долларах или рублях, более 20 способов оплаты;</li>\r\n<li><strong>более 8 видов доставки грузов</strong> (таблица выше)</li>\r\n<li>автоматизированный расчет доставки&nbsp;при оформлении заказа + <a href=\\"calculator\\" target=\\"_blank\\">КАЛЬКУЛЯТОР</a>;</li>\r\n<li>отчет о ходе исполнения заказа на сайте в &laquo;Личном кабинете&raquo; и по электронной почте;</li>\r\n<li>история взаиморасчетов;</li>\r\n<li>возможность возврата средств.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Taozon </strong><strong>поощряет покупателей:</strong></p>\r\n<ul class=\\"listUL\\">\r\n<li>с лета 2013 года - <strong>330 руб. каждому</strong> зарегистрировавщемуся. <a href=\\"?p=news&amp;id=6\\" target=\\"_blank\\">Подробнее...</a></li>\r\n<li><a href=\\"search?search=%D0%BF%D0%BB%D1%8F%D0%B6&amp;from=320&amp;tmall=\\" target=\\"_blank\\">скидки на сезонные товары;</a></li>\r\n<li><a href=\\"sale\\" target=\\"_blank\\">скидки при покупке более чем на 5 000, 10&nbsp;000 и 20 000 т.р.;</a></li>\r\n<li>оптовикам - специальное предложение .</li>\r\n</ul>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>Taozon </strong><strong>открыт к диалогу:</strong></p>\r\n<ul class=\\"listUL\\">\r\n<li>служба поддержки клиентов в России;</li>\r\n<li>возможность задать вопрос личному консультанту (все обращения фиксируются);</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<h4><span style=\\"font-size: 1em;\\">Контактная информация</span></h4>\r\n<p><strong>1.&nbsp;<strong>Обратиться к \\"ОНЛАЙН КОНСУЛЬТАНТУ\\" (</strong></strong><span style=\\"color: #ff0000;\\"><strong>красный</strong></span><strong><span style=\\"color: #808080;\\">&nbsp;ярлычек справа на сайте</span>)</strong></p>\r\n<p class=\\"textcontent\\"><strong>2.&nbsp;Отправив электронное письмо на&nbsp;</strong><strong><a href=\\"mailto:info@taozon.ru\\">info@taozon.ru</a></strong></p>\r\n<p><strong>3.&nbsp;Обратившись в&nbsp;<a href=\\"index.php?p=support&amp;mode=new\\" target=\\"_blank\\">службу поддержки</a>.&nbsp;<strong><span>(<span style=\\"color: #ff0000;\\">только зарегистрированным пользователям!</span>)</span></strong></strong></p>\r\n<p><strong>4.&nbsp;</strong><strong>По телефонам:</strong></p>\r\n<p><strong>Тел оф.: +7 (4162) 53-65-10 (пн-пт, с 03.00 до 15.00 МСК)</strong></p>\r\n<p><strong>Тел сот.: +7 (9638) 14-37-88&nbsp;<strong>(пн-вс, с 03.00 до 16.00 МСК)</strong></strong></p>\r\n<h4><span style=\\"font-size: 1em;\\">Taozon.ru &mdash; ваш надежный &nbsp;и удобный поставщик товаров из Китая!</span></h4>\r\n<h4>&nbsp;</h4>\r\n<h4><span style=\\"font-size: 1em;\\">Зачем покупать товары в Китае?</span></h4>\r\n<p>Китай называют &laquo;фабрикой мира&raquo;. Если еще 10 лет назад качество&nbsp;<strong>товаров из Китая </strong>вызывало много нареканий, то на сегодняшний день ситуация изменилась кардинально: Китай стал огромным технологическим парком, где собраны новейшие достижения науки и техники, а интерес к <strong>китайским товарам</strong>&nbsp;растет с каждым годом. Растущая привлекательность&nbsp;<strong>товаров из Китая</strong>&nbsp;объясняется, прежде всего, низкой стоимостью производимой продукции, которая достигается за счет дешевой, но квалифицированной рабочей силы. Сегодня в Китае есть производители практически любого вида продукции, выпускаемой в мире: от брелков для ключей и пластиковой посуды до медицинского оборудования и автомобилей. Если вы хотите покупать недорогие и качественные&nbsp;<strong>китайские товары</strong>, лучшее место для этого &mdash; крупнейший&nbsp;<strong>интернет-магазин Китая Taobao.com</strong>.</p>\r\n<h4><span style=\\"font-size: 1em;\\">Немного о Taobao?</span></h4>\r\n<p>Основанные в 2003 году известной китайской компанией Alibaba Group&nbsp;<strong>китайские интернет-магазины Taobao.com и Tmall</strong>&nbsp;на сегодняшний день являются крупнейшими&nbsp;<strong>онлайн-магазинами</strong>&nbsp; в китайском сегменте интернета с годовым оборотом в почти 60 миллиардов долларов и 300 миллионами пользователей, занимая, согласно результатам исследования компании iResearch, почти 75% рынка.&nbsp;<strong>Таобао и Тимолл</strong>&nbsp;дают возможность покупать&nbsp;<strong>китайские товары</strong>&nbsp;у тысяч различных продавцов, среди которых есть как&nbsp;<strong>крупные ретейлеры</strong>&nbsp;(например, официальные магазины на Таобао есть у известного японского бренда&nbsp;<strong>Uniqlo</strong>, европейских , Vero Moda, Jack Jones и др.), так и индивидуальные производители и поставщики.</p>\r\n<h4><span style=\\"font-size: 1em;\\">Можно ли купить товары на Таобао напрямую?</span></h4>\r\n<p>До недавнего времени российские потребители были ограничены в возможности приобретать товары в <strong>китайском интернет магазине</strong>&nbsp;<strong>Таобао</strong>. Во-первых, весь каталог товаров, равно как и интерфейс портала <strong>taobao.com</strong>, доступны только на китайском языке. Во-вторых, купленные на сайте taobao.com&nbsp;<strong>китайские товары</strong>&nbsp;не могут быть доставлены в Россию. Последняя проблема частично решается компаниями-посредниками, которые самостоятельно подбирают клиенту товар на&nbsp;<strong>taobao.com</strong>&nbsp;и доставляют его, взимая существенную комиссию. Помимо затрат на услуги посредника в такой ситуации клиент не имеет возможности подбирать товар самостоятельно, а также рискует связаться с недобросовестным посредником.</p>\r\n<p>Taozon &ndash; это&nbsp;<strong>партнер программы Taobao в России. С помощью нашего интернет-магазина можно купить китайские товары в самом большом интернет-магазине Китая Taobao.com напрямую, самостоятельно</strong>, и не рискуя пострадать от действий нечестного посредника.</p>\r\n<p>На&nbsp;<strong>Taozon.ru</strong>&nbsp;вы можете найти нужные вам&nbsp;<strong>китайские товары</strong>&nbsp;в полностью&nbsp;<strong>русифицированном каталоге, заказать и оплатить товар, и отследить все этапы доставки</strong>.</p>\r\n<p><span style=\\"font-family: Arial; font-size: 21px; font-weight: bold; line-height: 23px;\\">Желаем Вам легких покупок с Taozon ! &nbsp; &nbsp; &nbsp; &nbsp;<span style=\\"font-size: small;\\"><a href=\\"index.php\\" target=\\"_blank\\">Начать шопинг...</a></span></span></p>\r\n<p><span style=\\"font-family: Arial; font-size: 21px; font-weight: bold; line-height: 23px;\\"><img src=\\"uploaded/%20друзья%20Taozon%202.jpg\\" alt=\\"\\" width=\\"695\\" height=\\"434\\" /><br /></span></p>'),
(26, 26, 0, '<p><span style=\\"font-family: Arial; font-size: 21px; font-weight: bold; line-height: 23px;\\"><img src=\\"uploaded/%20Taozon.jpg\\" alt=\\"\\" width=\\"693\\" height=\\"330\\" /></span></p>\r\n<p><span style=\\"font-family: Arial; font-size: 21px; font-weight: bold; line-height: 23px;\\">Уважаемые Клиенты, мало того, что наши цены просто \\"смешные\\", мы всегда рады сделать Вам приятный подарок в виде скидок которые выглядят следующим образом:</span></p>\r\n<ol class=\\"listOL\\">\r\n<li><span style=\\"color: #000000; font-family: arial, helvetica, sans-serif; font-size: small; font-weight: bold; line-height: 20px;\\">Если Ваш заказ от 5 000 рублей - Вам автоматически зачтется <span style=\\"color: #ff0000;\\">скидка в 2%;</span></span></li>\r\n<li><span style=\\"color: #000000; font-family: arial, helvetica, sans-serif; font-size: small; font-weight: bold; line-height: 20px;\\">Если заказ превысит 10 000 рублей <span style=\\"color: #ff0000;\\">- 3%;</span></span></li>\r\n<li><span style=\\"color: #000000; font-family: arial, helvetica, sans-serif; font-size: small; font-weight: bold; line-height: 20px;\\">При достижении Вашим заказом рубежа в 20 000 рублей - получите <span style=\\"color: #ff0000;\\">5% скидку.</span></span></li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p>Обращаем Ваше внимание, что при сумме заказа менее чем на 1000 рублей,&nbsp;<strong><span style=\\"color: #ff0000;\\">минимальная наценка на ЗАКАЗ составляет 300 рублей.</span></strong></p>\r\n<p>То есть, если Вы заказали, к примеру, товар за 100 рублей и весом 0.2 кг, то цена его будет не 100, а 400 рублей.</p>\r\n<p>Поэтому рекомендуем Вам формировать заказы в среднем от 1 500 - 2 000 рублей.</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\\"color: #000000; font-family: arial, helvetica, sans-serif; font-size: medium;\\">Желаем Вам легких и выгодных покупок с Taozon! </span><a style=\\"font-family: arial, helvetica, sans-serif; font-size: medium;\\" href=\\"allcats\\">Перейти в каталог.</a></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>');
INSERT INTO `news` (`id`, `title`, `brief`, `text`, `image`, `created`) VALUES
(3, 'Теперь на Taozon стало еще удобнее !', 'Уважаемые Друзья, в нашем интернет - магазине появилось очень удобное всплывающее меню в категориях и подкатегориях. Это позволит Вам экономить время на поиске нужного Вам товара.\r\nЖелаем Вам легких покупок !', '<h1 class=\\"editor\\">Уважаемые Друзья, в нашем интернет - магазине появится очень удобное всплывающее меню в категориях и подкатегориях. При наведении мышкой на необходимую категорию, подкатегории будут всплывать автоматически. Это позволит Вам экономить время на поиске нужного Вам товара.</h1>\r\n<p class=\\"editor\\">&nbsp;</p>\r\n<h1 class=\\"editor\\">Желаем Вам легких покупок !&nbsp;</h1>', 'http://taozon.ru//brands_uploads/214.png', '2013-06-20 15:03:09'),
(7, 'Приносим свои извинения ...', 'С 5 по 7 июля 2013 на нашем сайте будут проводиться технические работы.', '<h1 class=\\"editor\\">Уважаемые Клиенты, в связи с тем, что мы переходим на более скоростной выделенный сервер, в период с 8-го по 12-е июля 2013 года, скорость открытия страниц на сайте может быть медленнее обычного. Приносим свои извинения!</h1>', 'http://taozon.ru//brands_uploads/sorry (1).jpg', '2013-07-05 12:59:47'),
(6, '330 рублей каждому !', 'Регистрируйся на Taozon\r\nПОЛУЧАЙ 330 рублей на первый заказ', '<h1 class=\\"editor\\">Друзья, рады Вам сообщить, что теперь получить 330 рублей на свой первый заказ может каждый зарегистрировавшийся !</h1>\r\n<p><span style=\\"font-size: medium;\\"><strong>Единственное условие &ndash; сумма заказа не должна быть меньше 3&nbsp;000 рублей.</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p><strong style=\\"font-size: small;\\">Желаем Вам легких покупок с Taozon ! &nbsp;&nbsp;<a href=\\"register\\">Зарегистрироваться &gt;&gt;</a></strong></p>', 'http://taozon.ru//brands_uploads/11720106_S_1.jpg', '2013-06-25 12:01:38');
