INSERT INTO `reviews` (`review_id`, `item_id`, `category_id`, `name`, `email`, `text`, `accepted`, `created`) VALUES
(5, '18383932095', 'otc-3164', 'esc-test', NULL, 'Неплохая вещица. Рекомендую.', 1, '2013-06-15 14:40:12'),
(6, '13592525332', 'otc-1813', 'Shpio', NULL, 'хорошая сумка, очень вместительная, ткань плотная, не грязнится, швы прочные, ровные. Качество очень хорошее!', 1, '2013-06-21 06:57:48'),
(7, '8330493889', 'otc-1797', 'Suroviy', NULL, 'Купальник очень понравился. Качество хорошее, сделан из плотного трикотажа и бархата. Антистатичный, ничего не липнет. Брали размер S на рост 150см.', 1, '2013-06-21 08:08:15'),
(8, '13592525332', 'otc-1813', 'Suroviy', NULL, 'Так и есть, я тоже такую брала,)) Дочке для тренировок. ', 1, '2013-06-21 08:10:43'),
(9, '15833211656', 'otc-2811', 'sverstka', NULL, 'не заменимая вещь. Сократила мои расходы денег и времени. Я практически сама стала косметологомJ)))))))!', 1, '2013-06-21 08:28:35'),
(10, '15574693719', '50023573', 'krasotaaa', NULL, 'Джинсы теплые, плотные. Носила и осенью и зимой. Ткань-стрейч, тянется. Качеством довольна. Модель к низу зауженная, удобно носить под любую обувь и даже сапоги. Заказывала размер XXL, мой рост 173 см. Длина брюк по щиколотку.', 1, '2013-06-21 08:39:30'),
(11, '16730706324', 'otc-3932', 'Yagodka_Klubni4ka', NULL, 'Очень классный, красивый чехол, приятный на ощупь, цвета сочнее, чем на фото. Моя люмиа в нем КРАСОТКА! )))', 0, '2013-06-23 05:41:23'),
(12, '17206648351', 'otc-3', 'Yagodka_Klubni4ka', NULL, 'Платье достойное, хорошее качество, выглядит как на картинке, празднично. На рост 169 и 44 размер село идеально, длина тоже хорошая. юбка красивая, летящая, подъюбник из нормального материала. Кружевные круги смотрятся, скорее, как на модели, чем как на манекене - чуть выше груди, но это совершенно не портит внешний вид. За такие деньги - хорошая вещь.', 0, '2013-06-23 05:47:15'),
(13, '19054232576', 'otc-3', 'Elena_05041986', NULL, 'Платье смотрится хорошо, но размер S пойдет на худеньких и высоких девушек - не ниже 168-170 сантиметров, Невысоким придется убирать длину. Материал и качество выполнения хорошие. Заказывали сестре S-ку, но т.к. она низенькая, то ей длина была до самого пола, у меня размер M, мне также платье подошло, длину не надо убирать совсем - по размеру тоже хорошо село. ', 0, '2013-07-04 11:35:47'),
(14, '19054232576', 'otc-3', 'Elena_05041986', NULL, 'Забыла написать, платье пришло с поясом, пояс некрасивый, к тому же у него спереди дешевые китайские стразы, одна из которых выпала, НО его отсутствие нисколько не портит платье, даже наоборот, резинка на талии позволяет сделать небольшой напуск, с красивым поясом , думаю, тоже будет шикарно смотреться', 0, '2013-07-04 11:37:54'),
(15, '19588215916', 'otc-3', 'Yul4ik', NULL, 'Всем привет. Заказала платье - осталась довольна. Платье не делится по размерам, но на мой рост - 160 см - и размер - S - село очень здорово. качество не разочаровало. Заказывала черного цвета. подъюбник выше колена, верх платья содержит такое же кружево, которым отделан низ. хороший бюджетный вариант', 0, '2013-07-04 11:57:27'),
(16, '18468077234', 'otc-3', 'Modnizzza_1987', NULL, 'Платье красивое. Долго на сайте выбирала - подобные платья есть у разных производителей в разных цветовых вариантах, но смотрела фото все внимательно - у более дешевых аналогов на юбке спереди есть шов, поэтому остановилась на этом варианте и скидка оказалась кстати ))). Выбрала синего цвета. Понравилось, цвет платья приятный, как на картинке. размер подошел идеально, шифон приятный, воротничок отделан хорошо, и главное, на юбке нет шва спереди. Выглядит достаточно празднично, но не вычурно, платье, что называется \\"и в пир, и в мир, и в добрые люди\\". ', 0, '2013-07-04 12:09:45'),
(17, '24372104360', 'otc-3932', 'Tvoja_da_Tvoja', NULL, 'Чехол яркий, как на фото, брала разноцветный. выглядит симпатично', 0, '2013-07-04 12:15:55'),
(18, '22567688613', 'otc-3', 'Sverlana_Valentinovna_1964', NULL, 'Здравствуйте. Купила это платье и еще одно - голубое - этой же марки. Пришла посылка - платье красивое, цвета сочные, как на фото на модели, шифон тонкий, приятный к телу, летящий, струящийся. Удобство - резинка под грудью на нестандартную фигуру - отличное решение, на рост 167 см, объем груди и бедер 100, талию 83 заказывала размер L. Село идеально, длина хороша. Единственное - предполагала, что подкладка будет как на картинке на всем платье, по факту - сверху подкладка темно-зеленая, а юбка выполнена из двух слоев шифона, из которого все платье сделано - т.к. ткань очень тонкая, летняя, то юбка в целом немного прозрачная, но это придает экстравагантности. Осталась очень довольна изделием, его качеством, внешним видом и ценой.  ', 0, '2013-07-05 07:55:22'),
(19, '22567688613', 'otc-3', 'Sverlana_Valentinovna_1964', NULL, 'Прошу прощения, заказывала размер XL на описанные выше параметры', 0, '2013-07-05 07:56:09'),
(20, '16056979488', 'otc-3', 'Sverlana_Valentinovna_1964', NULL, 'Заказывала два платья этой фирмы, осталась довольна. На параметры : рост 167, объем груди и бедер 100, талию 83 заказала размер XL - село хорошо, более полную грудь будет облегать. Шифон тонкий, красивый, летящий, подъюбник не прозрачный, юбка красивая, пышная, летящая, в спокойном положении она не такая пышная как на фото, но при хотьбе очень красиво развивается. Качеством, внешним видом и ценой довольна. ', 0, '2013-07-05 08:02:13'),
(21, '18472433695', 'otc-3', 'Shopogolik1989', NULL, 'УРА,УРА,УРА. наконец-то пришло платьюшко. Цвет насыщеннее, чем на картинке, Универсальный размер хорошо сел на мой 44 верх и 46 низ )). Длина тоже не подвела - как надо. Материал хороший, подъюбник обычный синтетический, но не прилипает к ногам. Верх можно регулировать золотистым жгутиком, который на картинке  на спине модели с перышками висит, Т.е. через плечи можно ытянуть и подровнять, расслабить - подогнать под плечи , шею и грудь. и я и родственники заценили платье ) ', 0, '2013-07-05 08:11:39'),
(22, '13139166492', 'otc-70', 'elena.aleana', NULL, 'Костюм состоит из двух вещей. Толстовка очень хорошего качества, подошла по размеру. Штанишки по качеству не очень (соответствует цене), коротковаты. Костюм не линяет, не вытягивается. Размер модели соответствует росту 12М- 80 см, 24М- 90см.', 0, '2013-07-08 13:49:49'),
(23, '15964716356', 'otc-70', 'elena.aleana', NULL, 'Комплект состоит из трех вещей. Трикотажная толстовка хорошего качества. Брюки и пиджак из плотной Х/Б ткани. При стрики не линяет, не деформируется, не растягивается. Цвет соответствует фото на сайте. Размер 16 на рост 105 см. Костюм стильный, хоть и не фирменный, но очень красивый, модный и очень качественно сшит.', 0, '2013-07-08 13:53:10'),
(24, '13777038008', 'otc-20', 'elena.aleana', NULL, 'Качество хорошее, цвет как на картинке (розовый), размер универсальный, подошел на рост 160см. В капюшоне хлопковый подклад. Теплая и красивая.', 0, '2013-07-08 13:56:05'),
(25, '16275740286', 'otc-4', 'elena.aleana', NULL, 'Качество отличное, фирменное, размер XS на рост 155 см, цвет такой же как на фото.', 0, '2013-07-08 13:57:57'),
(26, '16128765693', 'otc-5', 'elena.aleana', NULL, 'Качество хорошее, как на картинке, размер подошел, очень довольная, ношу с удовольствием.', 0, '2013-07-08 14:01:49'),
(27, '13823519908', 'otc-151', 'vas.katrina', NULL, 'плюшевый костюмчик, очень теплый. Размер XL на рост 165-170 см. не линяет.', 0, '2013-07-08 14:26:17'),
(28, '13405617378', 'otc-151', 'vas.katrina', NULL, 'теплый, мягкий, уютный домашний костюмчик. Размер XL на рост 170см, штанишки коротковаты. Не электризуется. ', 0, '2013-07-08 14:28:30'),
(29, '12736242052', 'otc-32', 'Lada', NULL, 'Отличный деловой костюм. платье футляр,без рукавов, отрезное по талии, выполнено из плотного трикотажа хорошего качества, на подкладе. Жакет выполнен из ткани с трикотажной нитью характерного плетения; на подкладе с двумя прорезными карманами и отделан тканью из которой сшито платье. качество изделия высокое. модель смотрится достойно. выкрайка рассчитана на рост 164 см. на более высоких девушках талия у платья будет завышенная, соответственно и длина юбки будет короче. костюм очень хороший, Жакет можно комбинировать с другой одеждой. Я очень довольна костюмом)))! ', 0, '2013-07-10 04:42:58'),
(30, '12877341634', 'otc-22', 'Lada', NULL, 'Демисезонное двубортное плащ-пальто сшито из кружевного полотна на атласе, подклад шелковый. модель приталенная, классическая рассчитана на  рост 170 см, талия на месте, рукав длинный, длина пальто чуть выше колена.Лекало европейские. Цвет темно-бежевый или золотисто-коричневый. Качество высокое!!! Размер XL соответствует 46. Пальто смотрится элегантно, стильно, модно и дорого!!!', 0, '2013-07-10 05:43:06'),
(31, '12831990985', 'otc-214', 'Lada', NULL, 'Туфли из натуральной кожи, замшевые, колодка удобная, каблук 13 см, платформа в подносочной части 3см. размер соответствует российским. смотрятся элегантно. ношу с большим удовольствием!  :)', 0, '2013-07-10 06:09:38'),
(32, '12832177630', 'otc-214', 'Lada', NULL, 'Туфли весьма удобные, не смотря на высокий каблук 13 см. хорошая, удобная колодка. кожа натуральная, отделка замша. Размер соответствует российскому, брала кофейного цвета( темно телесного). Очень Довольна покупкой!', 0, '2013-07-10 06:16:00'),
(33, '18167212119', 'otc-217', 'Lada', NULL, 'Я влюбилась в эти босоножки на танкетке, они мне очень нравятся! удобные, красивые, из натуральной кожи! Цвет как на фото. размер соответствует российскому. Я довольна покупкой! Спасибо! ', 0, '2013-07-10 06:35:00');
