(6, '', '', '', 'Обязательно вернем в течении суток. Спасибо за обращение.', 5, -100, 'Out', 1, 1371198822),
(7, 'по заказу', 'ORD-0000000018', 'Common', 'Здравствуйте. Вес товара изменился, просим доплатить недостающую сумму в 30 рублей, спасибо. ', 0, 3820, 'In', 0, 1371201162),
(8, '', '', '', 'понял, оплачу.', 7, 3820, 'In', 0, 1371201374),
(9, 'Оплата наличными', '', '', 'Оплата наличными. Надо что-то делать.', 0, 0, 'In', 0, 1371282404),
(10, 'как правильно оплатить через терминал', 'ORD-0000000022', 'Paymеnt', 'какой мой номер счета для оплаты заказа через терминал?', 0, 87153, 'In', 0, 1371535445),
(11, 'оплата', 'ORD-0000000022', 'Paymеnt', 'заказ оплачен 18,06,2013 в 10:35 через терминал QIWI на личный номер 343829394551 (единый кошелек), и до сих пор не зачислены  на мой счет,  будьте так любезны проследите !', 0, 87153, 'Answer', 1, 1371555073),
(12, 'по заказу', 'ORD-0000000022', 'Common', 'Алена , здравствуйте.\r\nМы сделали вам тестовый платеж 15 руб. из вашего личного кабинета. Платеж прошел. Необходимо выяснять о вашем переводе у специалистов по терминалам QIWI кошелька. Может вы допустили какую то ошибку в номере счета Счет #343829394551 или в сумме платежа.\r\n', 0, 87153, 'Answer', 1, 1371604526),
(13, 'по заказу', 'ORD-0000000027', 'Common', 'Алена, здравствуйте, можно узнать, когда вы планируете оплатить заказ? Если есть вопросы, требуется помощь, пишите здесь либо в быстрый чат. ', 0, 87153, 'Answer', 1, 1371716814),
(14, 'по заказу', 'ORD-0000000013', 'Common', 'Марат, здравствуйте.\r\nПополнить счет можете в личном кабинете удобным для вас способом. http://taozon.ru/privateoffice Все интуитивно понятно.\r\nВ целом алгоритм следующий:\r\nРегистрируйтесь, делайте заказ, выбирайте доставку, оплачивайте на сайте удобным для Вас способом, получайте товар.\r\nОтслеживать все движения товара и вести переписку с консультантом можно в «личном кабинете» после регистрации.\r\nВсе просто!\r\nЛегких Вам покупок с Taozon.', 0, 77648, 'Answer', 1, 1371825302),
(15, 'по заказу', 'ORD-0000000030', 'Common', '       Надежда, здравствуйте.\r\nОриентируйтесь пожалуйста на \\"Общую сумму заказа\\" 5 319.00 руб. Остаток имеется ввиду то что осталось доплатить.\r\nПодробнее посмотреть заказ, товары в нем и другие действия с заказом, Вы можете просто кликнув по заказу ORD-0000000030 (?) Ссылка на него http://taozon.ru/index.php?p=privateoffice&orderid=ORD-0000000030', 0, 88151, 'Answer', 1, 1371827505),
(16, 'по заказу', 'ORD-0000000037', 'Common', 'Владислав Александрович , здравствуйте.\r\nСообщаем Вам, что минимальная наценка на товар 300 рублей не включая стоимости доставки.\r\nВиды доставки я Вам привожу ниже. ПРИМЕРНЫЙ вес товара 0,3 кг. а не 0 как Вы указали при оформлении заказа.\r\n\r\nСтоимость доставки 0,3 кг\r\nМеждународная служба доставки EMS	1008 руб.	\r\nChina Post. Сервис доставки посылок весом до 20 кг.	986 руб.	\r\nChina Post Airmail. Сервис доставки посылок весом до 2 кг.	307 руб.	\r\nМосква и Московская область. ЭКСПРЕСС доставка «СДЭК»	502 руб.	\r\nЛюбой город РФ, кроме Москвы и Московской области. ЭКСПРЕСС доставка «СДЭК»	628 руб.	\r\n\r\nЕсли Вас устраивают эти условия, выбирайте вид доставки и доплачивайте нужную сумму. Если нет, то можете добавить к заказу еще наименования, чтобы увеличить вес и удешевить доставку.\r\n\r\nЕсли ни один вариант не устраивает, мы готовы Вернуть Вам деньги.\r\n       ', 0, 89483, 'Answer', 1, 1372145971),
(17, '', '', '', 'Можно сменить вид доставки, например на China Post Airmail. Сервис доставки посылок весом до 2 кг.	307 руб.	+ 100 товар + 300 руб наценка. Итого 707 руб. ', 16, 89483, 'Out', 1, 1372147121),
(18, '', '', '', 'Мы выяснили вес вашего заказа 0.1 кг.\r\nМеждународная служба доставки EMS	1008 руб.	\r\nChina Post. Сервис доставки посылок весом до 20 кг.	986 руб.	\r\nChina Post Airmail. Сервис доставки посылок весом до 2 кг.	143 руб.	\r\n\r\nРекомендуем Вам последний вид доставки China Post Airmail. Сервис доставки посылок весом до 2 кг.	143 руб.	\r\nитого необходимо доплатить 443 рубля.\r\n', 16, 89483, 'Out', 1, 1372148371),
(19, 'по заказу', 'ORD-0000000040', 'Common', '       Здравствуйте, Светлана.\r\nВес указывается не на все товары таобао (мы транслируем вес что на китайском сайте, если он там не указан, то и у нас не отображается.) Предлагаю сделать следующим образом. Мы заказываем товар, затем он приходит на наш склад в Хэйхэ, там его взвешивают, вы доплачиваете, согласно весу, за доставку до вашего города. \r\nЧто касается 300 рублей на счет, эта скидка дается при стоимости заказа от 3 000 рублей.\r\n', 0, 90939, 'Answered', 1, 1372917724),
(20, '', '', '', 'Жду вашего ответа?       ', 19, 90939, 'Out', 1, 1372918852),
(21, '', '', '', 'последняя позиция в заказе - вес 80 г одна штука,\r\nостальные позиции все 140 грамм /  штука      ', 19, 90939, 'Out', 1, 1372926226),
(22, '', '', '', 'Хорошо, жду расчета по весу.', 19, 90939, 'In', 0, 1372996441),
(23, '', '', '', 'Светлана Евгеньевна, здравствуйте.\r\nПримерный вес вашего заказа составит 10 кг.\r\nРасчет стоимости доставки вы можете сделать в калькуляторе у нас на сайте. http://taozon.ru/calculator', 19, 90939, 'Out', 1, 1373020712),
(24, '', '', '', 'Рассчитана примерная стоимость доставки, товар \\"заказан\\", примерно через 5-7 дней он прибудет к нам на склад для точного взвешивания,после этого вам нужно будет сделать доплату за доставку товара. Мы Вам об этом сообщим в этом тикете.     ', 19, 90939, 'Out', 1, 1373021259),
(25, '', '', '', 'Все изменения по заказу можете отслеживать в личном кабинете, кликнув на заказ.       ', 19, 90939, 'Out', 1, 1373021309),
(26, 'по заказу', 'ORD-0000000026', 'Common', 'Алла Александровна, ваши деньги еще не поступили, просим вас выяснить причину в вашем банке и заодно, чтобы не терять время просим вас выслать скан платежного поручения  на почту taozon@mail.ru, мы попробуем узнать информацию еще и через единый кошелек. Спасибо!', 0, 87586, 'Answer', 1, 1373021575),
(27, '', '', '', 'как вы рассчитали стоимость доставки, не договорившись со мной о способе доставки и расценках? Опишите подробнее расчеты, откуда эта цифра 2773?\r\nORD-0000000040 (?)\r\n2013-06-29 07:50:28	4	1 970.00 руб. / 2 773.00 руб.	4 743.00 руб.	1 970.00 руб.	2 773.00 руб.	Ожидает доплаты \r\n\r\n\r\n', 19, 90939, 'In', 0, 1373034917),
(28, '', '', '', 'Алла Александровна? Сумма 12 800 не поступила на Ваш счет нашего интернет-магазина, пожалуйста уточните информацию о переводе в банке отправителе? И вышлите нам на электронную почту taozon@mail.ru платежку? Спасибо.      ', 26, 87586, 'Out', 0, 1373083834),
(29, 'по заказу', 'ORD-0000000039', 'Common', 'Ирина Рудольфовна, здравствуйте. Скажите, Вы уже оплатили заказ. Может есть какие то трудности? Мы готовы Вам помочь!', 0, 88609, 'Answer', 1, 1373084350),
(30, 'по заказу', 'ORD-0000000042', 'Common', 'Алена Анатольевна, здравствуйте.\r\nВы выбрали нужный Вам товар? Напоминаем Вам, чтобы заказ поступил в работу, его нужно оплатить с вашего счета у нас на сайте. Кликните по заказу и далее на кнопку \\"Оплатить заказ\\" \r\nСпасибо, что выбрали нас!      ', 0, 87153, 'Answer', 1, 1373176346),
(31, '', '', '', 'Алена Анатольевна, здравствуйте.\r\nВы выбрали нужный Вам товар? Напоминаем Вам, чтобы заказ поступил в работу, его нужно оплатить с вашего счета у нас на сайте. Кликните по заказу и далее на кнопку \\\\\\"Оплатить заказ\\\\\\" \r\nСпасибо, что выбрали нас!       ', 30, 87153, 'Out', 1, 1373176565),
(32, '', '', '', 'Вес в граммах 10160 гр. Цена 1970. Эти параметры заносите в калькулятор http://taozon.ru/calculator и получаете варианты доставки. \r\nУ Вас такая стоимость из-за веса товара. Пожалуйста определите для себя вид доставки и сообщите нам , подходит Вам это или нет? \r\nЖдем. Спасибо.', 19, 90939, 'Out', 1, 1373264551),
(33, '', '', '', 'Выбрала «ЖелДорЭкспедиция», доплата 2743 руб?', 19, 90939, 'In', 0, 1373347241),
(34, 'по заказу', 'ORD-0000000043', 'Common', 'Валерий Александрович, здравствуйте. Обращаем Ваше внимание на следующую информацию. http://taozon.ru/sale Если Вас устраивает изменение цены товара, пожалуйста согласитесь с ней в \\"заказе\\" в \\"личном кабинете\\" Цена будет изменена.       ', 0, 94811, 'Answer', 1, 1373352155),
(35, '', '', '', '       http://taozon.ru/index.php?p=privateoffice&orderid=ORD-0000000043', 34, 94811, 'Out', 0, 1373353153),
(36, '', '', '', 'Здравствуйте, Светлана Евгеньевна\r\nДа, верно,2743 руб. Ждем от Вас доплаты за товар, после этого мы переведем заказ в \\"Работу\\" Статусы заказа Вы сможете видеть в \\"Личном кабинете\\".\r\n', 19, 90939, 'Out', 1, 1373454988),
(37, '', '', '', 'Оплатила. На этот раз оплата прошла мгновенно', 19, 90939, 'In', 0, 1373456544);
